uid: azure.mgmt.storagecache.models.ImportStatusType
name: ImportStatusType
fullName: azure.mgmt.storagecache.models.ImportStatusType
summary: 'The state of the import job. InProgress indicates the import is still running.
  Canceled

  indicates it has been canceled by the user. Completed indicates import finished,
  successfully

  importing all discovered blobs into the Lustre namespace. CompletedPartial indicates
  the import

  finished but some blobs either were found to be conflicting and could not be imported
  or other

  errors were encountered. Failed means the import was unable to complete due to a
  fatal error.'
